	add("twilight", "{\"term\":\"twilight\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"low german\", \"Dutch\", \"scots\"], \"text\":\"From Middle english (1100-1500) \u0027twilight\u0027 \u0027twyelyghte\u0027 from Old english (ca. 450-1100) {{m|ang|twēonelēoht||twilight}}, equivalent to {{prefix|twi|light|t1\u003ddouble, half-|lang\u003den}}, literally ‘second light, half-light’. Cognate to Scots \u0027twa licht\u0027 \u0027twylicht\u0027 \u0027twielicht\u0027 (twilight) Low german \u0027twilecht\u0027 \u0027twelecht\u0027 (twilight) Dutch \u0027tweelicht\u0027 (twilight, dusk) German \u0027zwielicht\u0027 (twilight, dusk)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The soft light in the sky seen before the rising and (especially) after the setting of the sun, occasioned by the illumination of the earth’s atmosphere by the direct rays of the sun and their reflection on the earth\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The time when this light is visible; the period between daylight and darkness\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"At \u0027\u0027twilight\u0027\u0027 in the summer there is never anybody to fear—man, woman, or cat—in the chambers and at that hour the mice come out. They do not eat parchment or foolscap or red tape, but they eat the luncheon crumbs\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The time when the sun is less than 18° below the horizon\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Any faint light through which something is seen; an in-between or fading condition\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1632-1705\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027twilight\u0027\u0027 of probability\", \"priority\":7}]}, \"synonyms\":{}}");

